import React, { useState, useEffect } from 'react';
import Preview3DApi from './Preview3D/Preview3DApi';
import WebViewer3D from './Preview3D/WebViewer3D';
import Preview2DApi from './Preview2D/Preview2DApi';
import generateUrl from './ProductsAPIData/ProductDataAPI'
import Modal from './DownloadModals/Modal';
import Footer from './Footer/Footer';

import { getCytropacValues, getCytropacMiDent, computeCytropacTypecodeInfo, generateCytropacTabledata, generateAllPossibleTypecodesCytropac } from './Products/cytropac';
import { getCytroboxValues, getCytroboxMiDent, computeCytroboxTypecodeInfo, generateCytroboxTabledata, generateAllPossibleTypecodesCytrobox } from './Products/cytrobox';
import { get4We10hValues, get4We10hMiDent, compute4We10hTypecodeInfo, generateAllPossibleTypecodes4We10h, generate4We10hTabledata } from './Products/4we10';
import { get4WehValues, get4WehMiDent, compute4WehTypecodeInfo, generate4WehTabledata, generateAllPossibleTypecodes4Weh } from './Products/4weh';
import { getZ3dreValues, getZ3dreMiDent, computeZ3dreTypecodeInfo, generateAllPossibleTypecodesZ3dre, generateZ3dreTabledata } from './Products/z3dre';

import { defineCustomElements } from '@boschrexroth/nextgen-web-ui-toolkit-react';
defineCustomElements();

const TableDataApi = ({ initialFilepath }) => {
  const [data, setData] = useState(null);
  const [apiData, setApiData] = useState(null);
  const [miDent, setMiDent] = useState('');
  const [selectedLanguage, setSelectedLanguage] = useState('english');
  const [selectedValues, setSelectedValues] = useState('');
  const [isEditing, setIsEditing] = useState(false);
  const [typecodeInfo, setTypecodeInfo] = useState('');
  const [filepath, setFilepath] = useState(initialFilepath);
  const [prefix, setPrefix] = useState('');
  const [errorMessage, setErrorMessage] = useState('');
  const [, setAllTypecodesCytropac] = useState([]);
  const [, setAllTypecodesCytrobox] = useState([]);
  const [, setAllTypecodes4We10h] = useState([]);
  const [, setAllTypecodes4Weh] = useState([]);
  const [, setAllTypecodesZ3dre] = useState([]);
  const [isValidTypecode, setIsValidTypecode] = useState(false);
  const [messageTimeout, setMessageTimeout] = useState(null);
  const [showTooltip, setShowTooltip] = useState(false);
  const [currentTypeCode, setCurrentTypeCode] = useState('');
  const [Tabledata,setTabledata] = useState('');
  

  const handleApiData = (data) => {
    setApiData(data);
  };


  const renderRow = (label, values, fieldName, units) => {
    const selectedValue = selectedValues[fieldName];
    const selectedImageUrl = values.find(value => value.value === selectedValue)?.imageUrl;
  
    return (
      <tr key={fieldName}>
        <td>{label}</td>
        <td style={{ whiteSpace: 'normal', wordWrap: 'break-word', maxWidth: '500px' }}>
          {values.length === 1 ? (
            values[0].name
          ) : (
            <dc-ui-dropdown-wrapper>
              <select onChange={(e) => handleChange(fieldName, e.target.value)}>
                {values.map((item, index) => (
                  <option key={index} value={item.value}>{item.name}</option>
                ))}
              </select>
            </dc-ui-dropdown-wrapper>
          )}
          {selectedImageUrl && (
          <td>
            <img src={selectedImageUrl} alt={`${label} - ${selectedValue}`} style={{ width: '400px', height: '400px' }} />
          </td>
        )}
        </td>
        <td>{units}</td>
      </tr>
    );
  };
  
  useEffect(() => {
    const fetchData = async () => {
      try {
        
        const url = generateUrl(filepath, selectedLanguage);
        const response = await fetch(url);
        const result = await response.json();
        setData(result);
        console.log(result);
        const { NN } = result.index;
        const indexPath = result.index.line.values;

        if (NN === 'CytroBox') {
          const values = getCytroboxValues(result);
          setSelectedValues(values);
          setTypecodeInfo(computeCytroboxTypecodeInfo(selectedValues));
          const TableData = generateCytroboxTabledata(indexPath,renderRow)
          setTabledata(TableData)
        } else if (NN === 'CytroPac') {
          const values = getCytropacValues(result);
          setSelectedValues(values);
          setTypecodeInfo(computeCytropacTypecodeInfo(selectedValues));
          const TableData = generateCytropacTabledata(indexPath,renderRow)
          setTabledata(TableData)
        } else if (NN === 'WE 10.../H') {
          const values = get4We10hValues(result);
          setSelectedValues(values);
          setTypecodeInfo(compute4We10hTypecodeInfo(selectedValues));
          const TableData = generate4We10hTabledata(indexPath,renderRow)
          setTabledata(TableData)
        } else if (NN === 'WEH/WH-1X') {
          const values = get4WehValues(result);
          setSelectedValues(values);
          setTypecodeInfo(compute4WehTypecodeInfo(selectedValues));
          const TableData = generate4WehTabledata(indexPath,renderRow)
          setTabledata(TableData)
        } else if (NN === 'Z3DREE 10') {
          const values = getZ3dreValues(result);
          setSelectedValues(values);
          setTypecodeInfo(computeZ3dreTypecodeInfo(selectedValues));
          const TableData = generateZ3dreTabledata(indexPath,renderRow)
          setTabledata(TableData)
        }
      } catch (error) {
        console.error('Error fetching the data', error);
      }
    };
    fetchData();
  }, [selectedLanguage, filepath]);

  useEffect(() => {
    updateMiDent();
  }, [selectedValues, data]);

  const updateMiDent = () => {
    if (data && data.index && data.index.NN === 'CytroBox') {
      setMiDent(getCytroboxMiDent(selectedValues));
    } else if (data && data.index && data.index.NN === 'CytroPac') {
      setMiDent(getCytropacMiDent(selectedValues));
    } else if (data && data.index && data.index.NN === 'WE 10.../H') {
      setMiDent(get4We10hMiDent(selectedValues));
    } else if (data && data.index && data.index.NN === 'WEH/WH-1X') {
      setMiDent(get4WehMiDent(selectedValues));
    } else if (data && data.index && data.index.NN === 'Z3DREE 10') {
      setMiDent(getZ3dreMiDent(selectedValues));
    }
  };

  const handleChange = (field, value) => {
    setSelectedValues((prevValues) => {
      const newValues = { ...prevValues, [field]: value };
      const { NN } = data?.index || {};

      if (NN === 'CytroBox') {
        setTypecodeInfo(computeCytroboxTypecodeInfo(newValues));
      } else if (NN === 'CytroPac') {
        setTypecodeInfo(computeCytropacTypecodeInfo(newValues));
      } else if (NN === 'WE 10.../H') {
        setTypecodeInfo(compute4We10hTypecodeInfo(newValues));
      } else if (NN === 'WEH/WH-1X') {
        setTypecodeInfo(compute4WehTypecodeInfo(newValues));
      } else if (NN === 'Z3DREE 10') {
        setTypecodeInfo(computeZ3dreTypecodeInfo(newValues));
      }

      return newValues;
    });
  };

  const handleLanguageChange = (event) => {
    setSelectedLanguage(event.target.value);
  };

  const handleEditClick = () => {
    setIsEditing(true);
  };

  const handlePrefixChange = (event) => {
    const newPrefix = event.target.value;
    setPrefix(newPrefix);
  };

  // const validateEnteredTypecode(typecodes,typecodePrefix) =>{

  // }

  // const fetchDataForTypecode = async (typecodePrefix) => {
  //   try {
  //     const url = generateUrl(filepath, selectedLanguage);
  //     const response = await fetch(url);
  //     const result = await response.json();
  //     // const indexPath = data.index.line.values;
  //     let values, typecodes = '';
      
      // switch (typecodePrefix) {
      //   case 'CytroBox':
      //     values = getCytroboxValues(result);
      //     typecodes = generateAllPossibleTypecodesCytrobox(result.index.line.values);
      //     // setSelectedValues(values);
      //     // const typecodes = generateAllPossibleTypecodesCytrobox(result.index.line.values); 
      //     // validated_result =validateEnteredTypecode(typecodes,typecodePrefix)//boolean vaue result to be boolean in console log
      //     // if validateresult === True{

      //     //   TableData = generateCytroboxTabledata(indexPath,renderRow)


      //       // createMidentWithNewTypecode(typecodePrefix)
      //       // setTypecodeInfo(computeCytroboxTypecodeInfo(values));
      //     // }
      //     break;
      //   case 'CytroPac':
      //     values = getCytropacValues(result);
      //     typecodes = generateAllPossibleTypecodesCytropac(result.index.line.values);
      //     console.log(typecodes)
      //     break;
      //   case 'WE 10.../H':
      //     values = get4We10hValues(result);
      //     typecodes = generateAllPossibleTypecodes4We10h(result.index.line.values);
      //     break;
      //   case 'WEH/WH-1X':
      //     values = get4WehValues(result);
      //     typecodes = generateAllPossibleTypecodes4Weh(result.index.line.values);
      //     break;
      //   case 'Z3DREE 10':
      //     values = getZ3dreValues(result);
      //     typecodes = generateAllPossibleTypecodesZ3dre(result.index.line.values);
      //     break;
      //   default:
      //     throw new Error('Unknown typecode prefix');
      // }
      // const enteredTypecode = prefix.trim().toUpperCase();
  //     if (result.index.NN === typecodePrefix) {
  //       setSelectedValues(values);
  //       setTypecodeInfo(
  //         typecodePrefix === 'CytroBox' ? computeCytroboxTypecodeInfo(values) :
  //         typecodePrefix === 'CytroPac' ? computeCytropacTypecodeInfo(values) :
  //         typecodePrefix === 'WE 10.../H' ? compute4We10hTypecodeInfo(values) :
  //         typecodePrefix === 'WEH/WH-1X' ? compute4WehTypecodeInfo(values) :
  //         computeZ3dreTypecodeInfo(values)
  //       );
  //       if (typecodes.includes(prefix.trim().toUpperCase())) {
  //         setErrorMessage('');
  //         setIsValidTypecode(true);
  //         setTypecodeInfo(prefix.trim().toUpperCase());
  //       } else {
  //         setErrorMessage(selectedLanguage==='english'?`ENTERED ${typecodePrefix.toUpperCase()} TYPE CODE IS INVALID` : `EINGEGEBENER ${typecodePrefix.toUpperCase()} TYPENSCHLÜSSEL IST UNGÜLTIG` );
  //         setIsValidTypecode(false);
  //       }
  //     } else {
  //       setErrorMessage(selectedLanguage==='english'?`ENTERED ${typecodePrefix.toUpperCase()} TYPE CODE IS INVALID`: `EINGEGEBENER ${typecodePrefix.toUpperCase()} TYPENSCHLÜSSEL IST UNGÜLTIG`);
  //       setIsValidTypecode(false);
  //     }
  //   } catch (error) {
  //     console.error(`Error fetching ${typecodePrefix} data:`, error);
  //     setIsValidTypecode(false);
  //   }
  // };
  
  // const handleMouseEnter = () => {
  //   setShowTooltip(true);
  // };

  const handleMouseLeave = () => {
    setShowTooltip(false);
  };
  const validateTypecode = async (enteredTypecode, typecodePrefix) => {
    let isValid = false;
  
    switch (typecodePrefix) {
      case 'CytroBox':
        const allTypecodesCytrobox = await generateAllPossibleTypecodesCytrobox();
        isValid = allTypecodesCytrobox.includes(enteredTypecode);
        break;
  
      case 'CytroPac':
        const allTypecodesCytropac = await generateAllPossibleTypecodesCytropac();
        isValid = allTypecodesCytropac.includes(enteredTypecode);
        break;
  
      case 'WE10':
        const allTypecodes4We10h = await generateAllPossibleTypecodes4We10h();
        isValid = allTypecodes4We10h.includes(enteredTypecode);
        break;
  
      case 'WEH':
        const allTypecodes4Weh = await generateAllPossibleTypecodes4Weh();
        isValid = allTypecodes4Weh.includes(enteredTypecode);
        break;
  
      case 'Z3DRE':
        const allTypecodesZ3dre = await generateAllPossibleTypecodesZ3dre();
        isValid = allTypecodesZ3dre.includes(enteredTypecode);
        break;
  
      default:
        console.error('Unknown typecode prefix');
        break;
    }
  
    return isValid;
  };
  
  const handleKeyDown = async (event) => {
    if (event.key === 'Enter') {
      setIsEditing(false);
      const enteredTypecode = prefix.trim().toUpperCase();
      let isValid = false;
  
      if (enteredTypecode.includes('CYTROBOX')) {
        isValid = await validateTypecode(enteredTypecode, 'CytroBox');
      } else if (enteredTypecode.includes('CYTROPAC')) {
        isValid = await validateTypecode(enteredTypecode, 'CytroPac');
